var color_chenge = function(){
    $("span:contains('お23C')").parent().parent().parent().css("background-color","lightgoldenrodyellow");
}

setTimeout(color_chenge, 3000);

const prefix = {"あ":20,"い":60,"う":52,"え":30,"お":92,"か":30,"き":50,"く":60,"け":42,"こ":50,"さ":30,"し":42,"す":40,"せ":46,"協":9};
Object.keys(prefix).forEach(function(key) {
    var count = this[key];
    for (  var i = 1;  i <= count; i++ ) {
        let clubId = key + ('0' + i).slice(-2);

        // console.log(clubId);

        $('#' + clubId).hover(function(){
            $(this).css( "fill", "orange" );
            $('#circle-viewer').children().remove();
            $("span:contains('" + clubId + "')").parent().parent().parent().clone().appendTo('#circle-viewer');
            $('#circle-viewer').children("li").css("width","320px");
        },function(){
            $(this).css( "fill", "white" );  
        });
    }
}, prefix);

$(window).scroll(function() {
    scrollbox();
});

function scrollbox(){
    // 現在のスクロール位置を取得
    var scrollTop = $(document).scrollTop();
    console.log(scrollTop);
    if(800 < scrollTop) {
        $('#circle-viewer').css('position', 'static');
    } else if(100 < scrollTop) {
        $('#circle-viewer').css('position', 'fixed');
        $('#circle-viewer').animate({top: '10'}, {duration: 0});
    } else {
        $('#circle-viewer').css('position', 'static');
    }
}